  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Crescent Lake
  National Wildlife Refuge outlines Refuge accomplishments from September through
  December of 1950. The report begins by summarizing the weather conditions and food
  and cover during this period. Wildlife- including migratory birds, upland game birds,
  big game animals, furbearers, predators, rodents, raptors, and disease- is also
  covered. The Refuge development and maintenance section discusses physical developments
  and plantings. Resource management is outlined; topics include grazing. A progress
  report on field investigations and applied research is also provided. The public
  relations section of the report describes Refuge visitors. N-R forms are attached.\",\n\t\"owner_org\":
